function recursiveKeyObjectCreation(keyStr, val) {
    var obj = {};

    if (keyStr.includes(".")) {
        var key = keyStr.substring(0, keyStr.indexOf("."));
        var rest = keyStr.substring(keyStr.indexOf(".") + 1);

        obj[key] = recursiveKeyObjectCreation(rest, val);
    } else {
        obj[keyStr] = (isNaN(val)) ? val : parseInt(val);
    }

    return obj;
}

