var obj = {
    topic: 'custom_msg',
    payload: {}
};

obj.payload[msg.topic] = parseInt(msg.payload);

return obj;

context.set(msg.topic, msg.payload);

var onTime = new Date((context.get('plantLightTimeOn') | 0) * 1000); // (We treat the minutes as seconds) s -> ms
var offTime = new Date((context.get('plantLightTimeOff') | 0) * 1000); // (We treat the minutes as seconds) s -> ms

return {
    "payload": onTime.toISOString().substring(14, 19) + " - " + offTime.toISOString().substring(14, 19)
};

if (msg.topic == "CLEAR") {
    context.set('logs', []);

    return [{
        "payload": ""
    }, {
        "topic": "status",
        "payload": "OKAY"
    }];
} else if (msg.payload != "unknown" && msg.payload != "unavailable") {
    // Get global logs variable
    var logs = context.get('logs') || [];

    // Add log to "logs" array
    logs.push(msg.payload);
    context.set('logs', logs);

    // Get status
    // Message example: "[STATUS] MESSAGE..."
    var status = msg.payload.slice(1, msg.payload.indexOf("]"));

    // Generate HTML from array
    return [{
        "payload": "<p>" + logs.join("</p><p>") + "</p>"
    }, {
        "topic": "status",
        "payload": status
    }];
}

if (msg.payload.trim().split("\n").length > 1) {
    // Sends the trimmed CSV file on the 1 output
    msg.payload = msg.payload.trim();
    return [msg, null];
} else {
    // Sends an empty list on the 2 output
    return [
        null,
        { "payload": [] }
    ];
}

if (msg.hasOwnProperty("stop")) {
    context.set('deviceDataTide', null);
    context.set('deviceDataTime', null);
    context.set('deviceDataGetFlowMass', null);

    return null;
}

var tide = context.get('deviceDataTide');
var startTime = context.get('deviceDataTime');
var getFlowMass = context.get('deviceDataGetFlowMass');

var obj = {};
obj.payload = {
    "Tide": tide,
    "Start Time (UTC 0)": startTime,
    "End Time (UTC 0)": (new Date()).toISOString().replace("T", " ").substring(0, 19),
    "Flow Mass (l)": ((getFlowMass) ? msg.flowMass : "n/a")
};

context.set('deviceDataTide', msg.payload);
context.set('deviceDataTime', obj.payload["End Time (UTC 0)"]);
context.set('deviceDataGetFlowMass', (tide == "EMPTY" && msg.payload == "MIDWAY"));

if (tide !== null && startTime !== null && getFlowMass !== null) return obj;

